import React, { Component } from "react";
import Articles from "../Articles/Articles";
import Search from "../Search/Search";
const Index = () => {
  return (
    <React.Fragment>
      <br />
      <br />
      <br />
      <Search />
      <Articles />
    </React.Fragment>
  );
};

export default Index;
